import React from "react";

function Input(props) {
  return (
    <div> 
    <form className="form">
      <input type="text" placeholder="Username" value={props.username} />
      <input type="password" placeholder="Password" />
      <button type="submit">Login</button>
    </form>
    </div>
  );
}

export default Input;
